import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';

const MaidDashboard = () => {
  const { user, token } = useAuth();

  const [stats, setStats] = useState([
    { label: 'Pending Requests', value: '0', icon: '📋' },
    { label: 'Completed Jobs', value: '0', icon: '✅' },
    { label: 'This Month', value: '₹0', icon: '💰' },
    { label: 'Rating', value: user?.profile?.rating?.average?.toString() || '4.8', icon: '⭐' }
  ]);

  const [pending, setPending] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState('');

  const loadBookings = async () => {
    try {
      setLoading(true);
      const { data } = await axios.get(`${process.env.REACT_APP_API_URL}/bookings`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      const list = data?.data?.bookings || [];
      setPending(list);
      // Update pending stat
      setStats(prev => prev.map(s => s.label === 'Pending Requests' ? { ...s, value: String(list.length) } : s));
    } catch (e) {
      setErr(e?.response?.data?.message || 'Failed to load bookings');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (token) loadBookings();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [token]);

  const updateStatus = async (id, status) => {
    try {
      await axios.put(`${process.env.REACT_APP_API_URL}/bookings/${id}/status`,
        { status },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      // Remove from pending on success
      setPending(p => p.filter(b => b.id !== id));
      setStats(prev => prev.map(s => s.label === 'Pending Requests' ? { ...s, value: String(Math.max(0, Number(s.value) - 1)) } : s));
    } catch (e) {
      alert(e?.response?.data?.message || 'Failed to update status');
    }
  };

  const accept = (id) => updateStatus(id, 'confirmed');
  const decline = (id) => updateStatus(id, 'declined');

  return (
    <div className="max-w-7xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-2">Welcome, {user?.name}</h1>
      <p className="text-gray-600 mb-6">Manage requests and schedule</p>

      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        {stats.map((s, i) => (
          <div key={i} className="dashboard-stat">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-blue-100 text-sm">{s.label}</p>
                <p className="text-3xl font-bold">{s.value}</p>
              </div>
              <div className="text-3xl">{s.icon}</div>
            </div>
          </div>
        ))}
      </div>

      <div className="bg-white rounded-lg shadow">
        <div className="px-6 py-4 border-b border-gray-200">
          <h2 className="text-xl font-semibold">Pending Requests</h2>
        </div>
        <div className="p-6">
          {loading && <p className="text-gray-500">Loading…</p>}
          {err && <p className="text-red-600">{err}</p>}
          {!loading && !err && pending.length === 0 && (
            <p className="text-gray-500">No pending requests.</p>
          )}
          {!loading && pending.length > 0 && (
            <div className="space-y-4">
              {pending.map(req => (
                <div key={req.id} className="border rounded-lg p-4 hover:bg-gray-50">
                  <div className="flex justify-between items-start">
                    <div className="flex-1">
                      <h3 className="font-semibold text-lg">{req.service || 'Cleaning Service'}</h3>
                      {req.customerName && <p className="text-gray-600">Customer: {req.customerName}</p>}
                      <p className="text-gray-600">📅 {req.date} at {req.time}</p>
                      <p className="text-gray-600">📍 {req.address}</p>
                      {typeof req.amount !== 'undefined' && (
                        <p className="text-green-600 font-semibold">₹{req.amount}</p>
                      )}
                    </div>
                    <div className="flex gap-2 ml-4">
                      <button className="btn-secondary" onClick={() => accept(req.id)}>Accept</button>
                      <button
                        className="btn-outline text-red-600 border-red-600 hover:bg-red-600 hover:text-white"
                        onClick={() => decline(req.id)}
                      >
                        Decline
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default MaidDashboard;
